import React, { useEffect, useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import { fetchPost } from "../../redux/module/uploadTest";
import Post from "./Post";
import PostWrapperStyled from "../styled/mainStyled/PostWrapperStyled";

const Content = () => {
  const posts = useSelector((state) => state.uploadTest.posts);
  const dispatch = useDispatch();
  const postList = posts.map((post) => <li key={post.name}>{post.name}</li>);

  useEffect(() => {
    dispatch(fetchData());
  }, []);

  return (
    <PostWrapperStyled>
      <Post />
      <ul>{postList}</ul>
    </PostWrapperStyled>
  );
};

export default Content;
